import { HeartOutlined, InboxOutlined } from "@ant-design/icons";
import { Card, Form, Rate, Row, Upload } from "antd";
import TextArea from "antd/lib/input/TextArea";


const Comment = () => {

    const normFile = (e) => {
        console.log('Upload event:', e);
        if (Array.isArray(e)) {
          return e;
        }
        return e?.fileList;
      };

    return(
        <div>
            <Card
              style={{
                width: 300,
                marginLeft: 720, height: 0
              }}
              
            >
                <Row><h2>Comment</h2></Row>
                <Row><h2>My rate is...</h2></Row>
               <Row><Rate character={<HeartOutlined />} value={3} /></Row>  
              <br />
              <Row><h2>My commnet is...</h2></Row>
              <br />
              <Row> <TextArea
                    showCount
                    
                    maxLength={250}
                    style={{
                        height: 110,
                        resize: 'none',
                        
                    }}
                    />
                </Row>
                <br />
                <Row><h2>I recommend this!</h2></Row>
                <Row>
                <Form.Item >
        <Form.Item name="dragger" valuePropName="fileList" getValueFromEvent={normFile} noStyle>
          <Upload.Dragger name="files" action="/upload.do">
            <p className="ant-upload-drag-icon">
              <InboxOutlined />
            </p>
            <p className="ant-upload-text">Click or drag file to this area to upload</p>
            <p className="ant-upload-hint">Support for a single or bulk upload.</p>
          </Upload.Dragger>
        </Form.Item>
      </Form.Item>
                </Row>
            </Card>
            
        </div>
    );
};

export default Comment;
